import React, { useEffect, useState } from "react";
import { MapContainer, TileLayer, Marker, Popup, useMap } from "react-leaflet";
import L from "leaflet";
import "leaflet/dist/leaflet.css";
import "./App.css";

// === Custom Icons ===
import busIconImg from "./busIcon.png"; // upload your bus image and rename it as busIcon.png
import homeIconImg from "./home.png";   // optional home icon

const busIcon = L.icon({
  iconUrl: busIconImg,
  iconSize: [50, 50],
  iconAnchor: [25, 25],
});

const homeIcon = L.icon({
  iconUrl: homeIconImg,
  iconSize: [40, 40],
  iconAnchor: [20, 20],
});

// === Helper component to move map dynamically ===
function MoveToLocation({ position }) {
  const map = useMap();
  useEffect(() => {
    if (position) map.panTo(position);
  }, [position, map]);
  return null;
}

function App() {
  const route = [
    [30.3165, 78.0322], // Dehradun
    [29.8661, 77.8945],
    [29.4727, 77.7085],
    [29.2100, 77.0400],
    [28.6139, 77.2090], // Delhi
  ];

  const [busPos, setBusPos] = useState(route[0]);
  const [userPos, setUserPos] = useState([30.3155, 78.033]); // near Dehradun
  const [distance, setDistance] = useState("0.00");
  const [eta, setEta] = useState("0.0 min");
  const [index, setIndex] = useState(0);

  // === Move Bus Automatically ===
  useEffect(() => {
    const move = setInterval(() => {
      setIndex((prev) => {
        if (prev < route.length - 1) {
          const next = prev + 1;
          setBusPos(route[next]);
          return next;
        } else {
          clearInterval(move);
          return prev;
        }
      });
    }, 5000);
    return () => clearInterval(move);
  }, []);

  // === Distance Calculation ===
  useEffect(() => {
    const toRad = (x) => (x * Math.PI) / 180;
    const R = 6371;
    const dLat = toRad(busPos[0] - userPos[0]);
    const dLon = toRad(busPos[1] - userPos[1]);
    const a =
      Math.sin(dLat / 2) ** 2 +
      Math.cos(toRad(userPos[0])) *
        Math.cos(toRad(busPos[0])) *
        Math.sin(dLon / 2) ** 2;
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
    const dist = R * c;
    setDistance(dist.toFixed(2));
    setEta((dist / 0.6).toFixed(2) + " min"); // approx 0.6 km/min
  }, [busPos, userPos]);

  return (
    <div className="tracking-app">
      {/* === Header === */}
      <div className="header">
        <span className="back-btn">←</span>
        <h2>Live Tracking</h2>
      </div>

      {/* === Map === */}
      <MapContainer
        center={busPos}
        zoom={13}
        style={{ height: "calc(100vh - 120px)", width: "100%" }}
      >
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution="© OpenStreetMap contributors"
        />
        <Marker position={busPos} icon={busIcon}>
          <Popup>
            <strong>🚌 Bus Location</strong>
            <br />
            Moving towards Delhi
          </Popup>
        </Marker>

        <Marker position={userPos} icon={homeIcon}>
          <Popup>🏠 Your Location</Popup>
        </Marker>

        <MoveToLocation position={busPos} />
      </MapContainer>

      {/* === Bottom Info Bar === */}
      <div className="bottom-bar">
        <span>⏱ ETA: {eta}</span>
        <span>📍 Distance: {distance} km</span>
      </div>

      {/* === Floating Buttons === */}
      <div className="floating-buttons">
        <button className="fab orange">⚙️</button>
        <button className="fab red">🔁</button>
      </div>
    </div>
  );
}

export default App;
